import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <nav className="top-bar">
          <div className="top-bar-title">My App</div>
          <div className="top-bar-items">
            <a href="#">Home</a>
            <a href="#">About</a>
            <a href="#">Contact</a>
          </div>
        </nav>
        <h1>Welcome to My React TypeScript App</h1>
      </header>
    </div>
  );
}

export default App;
